import React from 'react';
import './Location.css';
import NearMeIcon from '@mui/icons-material/NearMe';
import { GrMapLocation } from "react-icons/gr";

function Location() {
  return (
    <div className='location-main'>
      <NearMeIcon className='nearme-icon' />
      <GrMapLocation />
      <p>helo</p>
    </div>
  );
}

export default Location;
